import './App.css';

const App = () => <PersonList />

const PersonList=() => {
  const People = [
    {
      img : 'cristian',
      name: 'Cristian Sipahutar',
      job: 'Mechanical Engineering'
    },
    {
      img : 'david',
      name: 'David Andrianus Hutapea',
      job: 'Senior Software Engineer'
    },
    {
      img : 'guitherez',
      name: 'Cristian Sipahutar',
      job: 'Mechanical Engineering'
    },
    {
      img : 'cristian Cropped',
      name: 'Cristian Sipahutar',
      job: 'Mechanical Engineering'
    },
  ]
  return <Person />
}

const Person = () => {
  const imgsrc = './files/cristian Cropped.jpg';
  return (
    <div className='person'> 
      <img src={imgsrc} alt='' />
      <div>
        <h4>Name</h4>
        <h4>Job</h4>
      </div>
    </div>
  )
}

export default App;
